    [],nt"num_tags": 0,nt"name": "proximate-analyses-utilization-of-marine-process-waste-for-aquaculture-feeds",nt"isopen":
    false,nt"url": null,nt"notes": "Limited amounts of forage fish are available
    as an ingredient in feeds for the expanding aquaculture industry. Work is being
    conducted on a variety of underutilized materials to provide new sources of protein,
    oils, and minerals for fish feeds. These materials include invasive species such
    as carp and mussels, waste from fish and clam processing, and process waste from
    fish farms. Successful utilization of these materials adds needed protein and marine
    oils to the growing aquaculture industry, and eliminates the environmental impact
    of landfill or dumping at sea of these waste streams.nnProximate analysis and solubility
    of new materials.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
